INSERT INTO `wp_posts` VALUES (1,1,'2018-01-02 10:01:58','2018-01-02 10:01:58','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','trash','open','open','','hello-world__trashed','','','2018-01-02 10:17:37','2018-01-02 10:17:37','',0,'http://localhost/bootcamp/finalas/?p=1',0,'post','',1),(2,1,'2018-01-02 10:01:58','2018-01-02 10:01:58','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://localhost/bootcamp/finalas/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','trash','closed','open','','sample-page__trashed','','','2018-01-02 10:08:39','2018-01-02 10:08:39','',0,'http://localhost/bootcamp/finalas/?page_id=2',0,'page','',0),(37,1,'2018-01-02 10:06:29','2018-01-02 10:06:29','[et_pb_section fullwidth=\"on\" background_color=\"#1f0030\"][et_pb_fullwidth_header title=\"Divi Builder\" background_layout=\"dark\" text_orientation=\"center\" scroll_down_icon_color=\"#ffffff\" scroll_down_icon_size=\"36px\" content_font_color=\"rgba(255,255,255,0.85)\" max_width=\"700px\" button_one_text=\"Join Now\" button_one_url=\"Join today\" background_overlay_color=\"rgba(