t=\"Montserrat||||||||\" body_font_size=\"18px\" body_line_height=\"3em\" background_color=\"#EDF8FF\" border_radii=\"on|10px|10px|10px|10px\" text_orientation=\"center\" custom_margin=\"|||\" orientation=\"left\" background_layout=\"light\" /][/et_pb_column][et_pb_column type=\"1_2\"][et_pb_text _builder_version=\"3.0.89\" background_layout=\"light\" text_font=\"Montserrat||||||||\" header_font=\"Montserrat||||||||\" header_font_size=\"34px\" custom_margin=\"|||30px\"]\r\n\r\n<h4>Individualūs rankų darbo papuošalai</h4>\r\n<p> Kuriu papuošalus įvairiomis technikomis: papuošalų ir aksesuarų iš karoliukų vėrimas,vėlimas, dekupažas.</p> \r\n\r\n<p>Įdomiais aksesuarais mėgstančioms pasipuošti moterims ir merginoms rankų darbo papuošalai yra ne tik puiki proga išskirti iš pilkos minios, bet ir atrasti savo talentą ar pomėgį.  Papuošalai gimsta tiesiog iš idėjos ir fantazijos. Papuošalai kartais gimsta skubotai, todėl reikia išmokti juos pagaminti neskubant.</p>\r\n <p>Šitoje svetainėje rasite tik rankų darbo individualius papuošalus, pagamintus naudojant įvairias technikas ir fantaziją. Jeigu Jums patinka kažkuris dirbinys, maloniai prašome jį įsigyti arba išmokti jį pasidaryti pačiam! :)\r\n</p>\r\n\r\n[/et_pb_text][/et_pb_column][et_pb_column type=\"1_4\"][et_pb_text _builder_version=\"3.0.89\" background_layout=\"light\"]\r\n\r\n<iframe src=\"https://www.facebook.com/plugins/page.php?href=https%3A%2F%2Fwww.facebook.com%2Foriginalusrankdarbiai%2F&tabs=timeline&width=340&height=500&small_header=false&adapt_container_width=true&hide_cover=false&show_facepile=true&appId\" width=\"340\" height=\"500\" style=\"border:none;overflow:hidden\" scrolling=\"no\" frameborder=\"0\" allowTransparency=\"true\"></iframe>\r\n\r\n[/et_pb_text][/et_pb_column][/et_pb_row][/et_pb_section]','Apie','','publish','closed','closed','','apie','','','2018-01-10 12:59:37','2018-01-10 12:59:37','',0,'http://localhost/bootcamp/finalas/?page_id=123',0,'page','',0),(124,1,'2018-01-02 13:38:38','2018-