t=\"light\"]\r\n\r\n<iframe src=\"https://www.facebook.com/plugins/page.php?href=https%3A%2F%2Fwww.facebook.com%2Foriginalusrankdarbiai%2F&tabs=timeline&width=340&height=500&small_header=false&adapt_container_width=true&hide_cover=false&show_facepile=true&appId\" width=\"340\" height=\"500\" style=\"border:none;overflow:hidden\" scrolling=\"no\" frameborder=\"0\" allowTransparency=\"true\"></iframe>\r\n\r\n[/et_pb_text][/et_pb_column][/et_pb_row][/et_pb_section]','Individualūs užsakymai','','publish','closed','closed','','individualus-uzsakymai','','','2018-01-10 13:06:31','2018-01-10 13:06:31','',0,'http://localhost/bootcamp/finalas/?page_id=125',0,'page','',0),(126,1,'2018-01-02 13:39:43','2018-01-02 13:39:43','','Individualūs užsakymai','','inherit','closed','closed','','125-revision-v1','','','2018-01-02 13:39:43','2018-01-02 13:39:43','',125,'http://localhost/bootcamp/finalas/?p=126',0,'revision','',0),(127,1,'2018-01-02 13:40:05','2018-01-02 13:40:05','[et_pb_section bb_built=\"1\" background_color=\"#f6fbff\" _builder_version=\"3.0.89\"][et_pb_row make_fullwidth=\"on\" custom_margin=\"|||30px\" _builder_version=\"3.0.89\" module_alignment=\"left\"][et_pb_column type=\"1_4\"][et_pb_sidebar area=\"sidebar-1\" show_border=\"off\" module_id=\"sticker\" _builder_version=\"3.0.89\" header_font_size=\"24px\" header_line_height=\"5em\" header_text_shadow_horizontal_length=\"0.04em\" header_text_shadow_vertical_length=\"0.04em\" header_text_shadow_blur_strength=\"0.27em\" body_font=\"Montserrat||||||||\" body_font_size=\"18px\" body_line_height=\"3em\" background_color=\"#EDF8FF\" border_radii=\"on|10px|10px|10px|10px\" text_orientation=\"center\" custom_margin=\"|||\" orientation=\"left\" background_layout=\"light\" /][/et_pb_column][et_pb_column type=\"1_2\"][et_pb_text _builder_version=\"3.0.89\" background_layout=\"light\" text_font=\"Montserrat||||||||\" header_font=\"Montserrat||||||||\" header_font_size=\"34px\" custom_margin=\"|||30px\" custom_css_main_element=\"list-style:none\"]\r\n\r\n<p>Pamokėlės vyksta  pas mane namuose Jums pageidaujančiu laiku ir diena. Viena pamokėlė trunka 2 val.,kaina 25 Eurai.</p>  \r\n                                    <h4>Pamokų temos:</h4>\r\n                                    \r\n                                        1) Kaip nepasiklysti karoliukų ir priemonių įvairovėje?\r\n                                        2) Auskarų vėrimas;\r\n                                        3) Apyrankių vėrimas (iš smulkių karoliukų);\r\n                                        4) Komplektukas (vėrinys ir auskarai) iš smulkių karoliukų;\r\n                                        5) Vėrinių gamyba panaudojant siuvinėjimo siūlus\r\n                                        6) Karoliukų vėrimas pagal schemas;\r\n                                        7) Kūrybinio darbo atlikimas (panaudojant papuošalų vėrimo kursų metu įgytas žinias).\r\n\r\n[/et_pb_text][/et_pb_column][et_pb_column type=\"1_4\"][et_pb_text _builder_version=\"3.0.89\" background_layout=\"light\"]\r\n\r\n<iframe src=\"https://www.facebook.com/plugins/page.php?href=https%3A%2F%2Fwww.facebook.com%2Foriginalusrankdarbiai%2F&tabs=timeline&width=340&height=500&small_header=false&adapt_container_width=true&hide_cover=false&show_facepile=true&appId\" width=\"340\" height=\"500\" style=\"border:none;overflow:hidden\" scrolling=\"no\" frameborder=\"0\" allowTransparency=\"true\"></iframe>\r\n\r\n[/et_pb_text][/et_pb_column][/et_pb_row][/et_pb_section]','Pamokos','','publish','closed','closed','','pamokos','','','2018-01-10 13:10:59','2018-01-10 13:10:59','',0,'http://localhost/bootcamp/finalas/?page_id=127',0,'page','',0),(128,1,'2018-01-02 13:40:05','2018-01-02 13:40:05','','Pamokos','','inherit','closed','closed','','127-revision-v1','','','2018-01-02 13:40:05','2018-01-02 13:40:05','',127,'http://localhost/bootcamp/finalas/?p=128',0,'revision','',0),(129,1,'2018-01-02 13:41:13','2018-01-02 13:41:13',' ','','','publish','closed','closed','','129'